export const ACTIONS = Object.freeze({
  LEFT_SWIPE: "left-swipe",
  RIGHT_SWIPE: "right-swipe",
});

export const TABS = Object.freeze({
  PROFILE: "profile",
  CHATS: "chats",
});

export const LEFT_ARROW_KEYCODE = 37;
export const RIGHT_ARROW_KEYCODE = 39;
